"use client";

import BetaBanner from "@/components/BetaBannner/BetaBanner";
import Navbar from "@/components/Navbar/Navbar";
import PromptBox from "@/components/PromptBox";
import GenerateButton from "@/components/GenerateButton";
import Image from "next/image";
import BottomBar from "@/components/BottomBar/BottomBar";
import axios from 'axios';
import { useGenerativeService, getComponentsFromPrompt } from "@/hooks/useGenerativeService";
import ComponentDisplaySection from "@/components/ComponentDisplaySection/ComponentDisplaySection";
import { copyToClipboard } from "figx";
import { handelOnCopy } from "../../utils/copyPaste";



export default function Home() {
  const { prompt } = useGenerativeService();
  const { setComponents } = getComponentsFromPrompt();

  var htmlContent =`<html>
  <body>
  <!--StartFragment--><meta charset="utf-8"><span data-metadata="<!--(figmeta)eyJmaWxlS2V5IjoicTREZmdwTWJOd2phQjFkTFBnV2xFMSIsInBhc3RlSUQiOjg0ODQyNzc3MiwiZGF0YVR5cGUiOiJzY2VuZSJ9Cg==(/figmeta)-->"></span><span data-buffer="<!--(figma)(/figma)-->"></span><span style="white-space:pre-wrap;">Discover the Best Deals<br>Shop Now<br>Explore More<br>Get Started</span><!--EndFragment-->
  </body>
  </html>`

  const copydata = handelOnCopy(htmlContent)

  const handleGenerate = async () => {
    try {
      const res = await axios.post("https://api.uxmagic.ai/api/plugins/suggest-component", { prompt });
      console.log(res.data);
      copyToClipboard(copydata);
      setComponents(res.data);
    } catch (error) {
      console.error('Error posting data:', error);
    }
  };
  return (
    <main className="flex flex-col h-full items-center relative">
      <Navbar logo="/Logo.svg" name="Component Generator" />

      <div className="w-full flex flex-col gap-3 text-sm px-3 pt-3">
        <BetaBanner />

        <div className="text-secondary text-base">
          Describe the component you want
        </div>

        <PromptBox />

        <GenerateButton
          onClick={() => {
            handleGenerate();
          }}
          disabled={prompt.trim().length === 0}
        >
          <Image src="/Star.svg" width={20} height={20} alt="Generate" />
          Generate
        </GenerateButton>

        <ComponentDisplaySection />
      </div>

      <BottomBar />
    </main>
  );
}
